// SPDX-License-Identifier: MIT

pragma solidity ^0.8.19;

import {AggregatorV3Interface} from "@chainlink/contracts@1.1.0/src/v0.8/shared/interfaces/AggregatorV3Interface.sol";
import {PriceConverter} from "./PriceConverter.sol";



error NotOwner();

contract FundMe {
    using PriceConverter for uint256;

    uint256 public constant MINIMUM_USD = 5e18;

    address[]  public funders;

    mapping (address funder => uint256 amountFunded) public funderAmount;

    address public immutable i_owner;

    constructor() {
        i_owner = msg.sender;
    }

    function fund() public payable {
        require(msg.value.getConversionRate() >= MINIMUM_USD, "Not enough money");
        funders.push(msg.sender);
        // funderAmount[msg.sender] = funderAmount[msg.sender] + msg.value;
        funderAmount[msg.sender] += msg.value;
    }

    function getAddress() public view returns(address) {
        return address(this);
    }

    function withdraw() public onlyOwner {
        // require(msg.sender == i_owner, "Only owner allowed");
        // for (starting index; ending index; step amount)
        for(uint256 funderIndex = 0; funderIndex < funders.length; funderIndex++) {
          //Starts at the zeroth element, ends when Index is greater than length, increases index by 1 after every loop.
            address funder = funders[funderIndex];
            //Gets address from the funders array uing index and assigns it to variable
            funderAmount[funder] = 0;
            //Sets the amountFunded by address gotten from array to 0 via mapping.
        }

        funders = new address[](0);
        //This line resets the funder array by crearing a new array and assigning it to the funders variable

        (bool callSuccess,) = payable (msg.sender).call{value: address(this).balance}("");
        require(callSuccess, "Call Failed");

    }

    modifier onlyOwner() {
      // require(msg.sender == i_owner, "No non owner access");
      if (msg.sender != i_owner) {revert NotOwner();}
      _;
      //The undersccore means execute function code after running the modifier code
    }

}

PriceConverter.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import {AggregatorV3Interface} from "@chainlink/contracts@1.1.0/src/v0.8/shared/interfaces/AggregatorV3Interface.sol";


library PriceConverter{
    function getPrice() internal view returns(uint256){
        AggregatorV3Interface priceFeed = AggregatorV3Interface(0x694AA1769357215DE4FAC081bf1f309aDC325306);
         (,int256 answer,,,) = priceFeed.latestRoundData();
         return uint256(answer * 1e10);
    }

    function getConversionRate(uint256 ethAmount) internal view returns (uint256) {
        uint256 ethPrice = getPrice();
        uint256 ethAmountInUsd = (ethAmount * ethPrice) / 1e18;
        return ethAmountInUsd;
     }

    function getVersion() internal view returns(uint256){
       return AggregatorV3Interface(0x694AA1769357215DE4FAC081bf1f309aDC325306).version();
    }
}

